import './App.css';
import { Header } from './Header';
import { BrowserRouter,Route } from 'react-router-dom';
import {AddProduct} from './AddProduct';
import { Login } from './Login';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Header />
        <Route path='/add'>
          <AddProduct />
        </Route>
      </BrowserRouter>

    </div>
  );
}

export default App;
